import React, { useEffect } from 'react';
import '../css/VideoPlayer.css';

export default function VideoPlayer({ videoLink, videoSource, username, setVideoLinkAndSourceInParent }) {
  useEffect(() => {
    getNewVideo(username);
  }, [username]);

  const getNewVideo = (username, setVideoLinkAndSourceInParent) => {
    if (username === null || username === '') {
      return;
    }

    const data = {
      username: username
    };

    fetch('https://yousub-api.nassing.tk/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    })
      .then(response => {
        if (response.ok) {
          return response.json();
        } else {
          throw new Error('Error getting video');
        }
      })
      .then(data => {
        setVideoLinkAndSourceInParent(data.link, data.source);
      })
      .catch(error => console.log(error.message));
  };

  return (
    <div id="video-player-wrapper">
      <div id="video-player">
        <video src={videoLink} controls loop />
      </div>
    </div>
  );
}
